import { BasketItem } from "../../components/BasketItem";
import { OrderDetail } from "../../components/OrderDetail";


export const BasketPage = () => {
  return (
    <div>
      <h2>Shopping cart</h2>
      <div>
        <p>Your shopping cart is empty</p>
      </div>
      <BasketItem />
      <OrderDetail/>
    </div>
  );
};
